window.bookSummaryJSON = "<p>The fourth novel in the acclaimed cult-favorite series starring necromancer Johannes Cabal </p> <p><i>Horst Cabal has risen from the dead - again.</i> </p> <p>Horst, the most affable vampire one is ever likely to meet, is resurrected by an occult conspiracy that wants him as a general in a monstrous army. Their plan is to create a country of horrors, a supernatural homeland. As Horst sees the lengths to which they are prepared to go and the evil they cultivate, he realizes that he cannot fight them alone. What he really needs on his side is a sarcastic, amoral, heavily armed necromancer. </p> <p>As luck would have it, this exactly describes his brother.</p>"; 
